import { Component, Inject } from '@angular/core';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-edit-profile-dialog',
  templateUrl: './edit-profile-dialog.component.html',
  styleUrls: ['./edit-profile-dialog.component.scss']
})
export class EditProfileDialogComponent {
  public user ={
    username: '',
    fullName: '',
    email: '',
    mobile_number: '',
  };

  public address = {
    addressLine1: '',
    addressLine2: '',
    city: '',
    state: '',
    postalCode: '',
    country: '',
  }

  constructor(
    public dialogRef: MatDialogRef<EditProfileDialogComponent>,
    @Inject(MAT_DIALOG_DATA) public data: any,
  ){}

  ngOnInit(){
    this.user = {...this.data.user};
    this.address = {...this.data.user.address};
  }

  public onNoClick(){
    this.dialogRef.close();
  }

  public onSaveClick(){
    const userData = {
      ...this.user,
      address: this.address
    };
    this.dialogRef.close(userData);
  }
}
<h2 mat-dialog-title>Edit Profile</h2>
<div mat-dialog-content>
  <mat-form-field appearance="fill">
    <mat-label>Username</mat-label>
    <input matInput [(ngModel)]="data.user.username" name="username" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Full Name</mat-label>
    <input matInput [(ngModel)]="data.user.full_name" name="full_name" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Email</mat-label>
    <input matInput [(ngModel)]="data.user.email" name="email" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Mobile</mat-label>
    <input matInput [(ngModel)]="data.user.mobile_number" name="mobile_number" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Address Line 1</mat-label>
    <input matInput [(ngModel)]="address.addressLine1" name="addressLine1" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Address Line 2</mat-label>
    <input matInput [(ngModel)]="address.addressLine2" name="addressLine2">
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>City</mat-label>
    <input matInput [(ngModel)]="address.city" name="city" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>State</mat-label>
    <input matInput [(ngModel)]="address.state" name="state" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Postal Code</mat-label>
    <input matInput [(ngModel)]="address.postalCode" name="postalCode" required>
  </mat-form-field>
  <mat-form-field appearance="fill">
    <mat-label>Country</mat-label>
    <input matInput [(ngModel)]="address.country" name="country" required>
  </mat-form-field>
</div>
<div mat-dialog-actions>
  <button mat-button (click)="onNoClick()">Cancel</button>
  <button mat-button color="primary" (click)="onSaveClick()">Save</button>
</div>
